import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Inprogress = () => {
  const [projects, setProjects] = useState([]);
  const [formData, setFormData] = useState({
    projectId: '',
    projectName: '',
    clientName: '',
    auditType: '',
    auditor: '',
    startDate: '',
    expectedEndDate: '',
    status: 'in-progress',
    notes: '',
  });

  const navigate = useNavigate();

  // Fetch in-progress projects on mount
  useEffect(() => {
    const fetchProjects = async () => {
      try {
        const res = await fetch('http://localhost:2000/api/projects/in-progress');
        const data = await res.json();
        if (data.projects) {
          setProjects(data.projects);
        }
      } catch (err) {
        console.error('❌ Failed to fetch projects:', err);
      }
    };

    fetchProjects();
  }, []);

  // Handle form input changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch('http://localhost:2000/api/projects', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      const newProject = await res.json();
      if (newProject) {
        setProjects([...projects, newProject]);
        setFormData({
          projectId: '',
          projectName: '',
          clientName: '',
          auditType: '',
          auditor: '',
          startDate: '',
          expectedEndDate: '',
          status: 'in-progress',
          notes: '',
        });
      }
    } catch (err) {
      console.error('❌ Failed to submit form:', err);
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <button onClick={() => navigate('/projects')} className='back-button'>
        ← Back
      </button>

      <h1 className='header'>In-Progress Projects</h1>

      {/* Form to add new in-progress project */}
      <form onSubmit={handleSubmit} style={{ marginBottom: '2rem' }}>
        <h2>Add New In-Progress Project</h2>

        <input type="text" name="projectId" value={formData.projectId} onChange={handleChange} placeholder="Project ID" required />
        <input type="text" name="projectName" value={formData.projectName} onChange={handleChange} placeholder="Project Name" required />
        <input type="text" name="clientName" value={formData.clientName} onChange={handleChange} placeholder="Client Name" required />
        <input type="text" name="auditType" value={formData.auditType} onChange={handleChange} placeholder="Audit Type" />
        <input type="text" name="auditor" value={formData.auditor} onChange={handleChange} placeholder="Auditor Name" />
        <input type="date" name="startDate" value={formData.startDate} onChange={handleChange} placeholder="Start Date" />
        <input type="date" name="expectedEndDate" value={formData.expectedEndDate} onChange={handleChange} placeholder="Expected End Date" />
        <textarea name="notes" value={formData.notes} onChange={handleChange} placeholder="Notes" rows="3"></textarea>

        <button type="submit">➕ Add Project</button>
      </form>

      {/* Display in-progress projects */}
      <ul>
        {projects.map((project, index) => (
          <li key={index}>
            {Object.entries(project).map(([key, value]) => (
              <div key={key}><strong>{key}:</strong> {value?.toString()}</div>
            ))}
            <hr />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Inprogress;
